import {
	authorize,
	fetchUsers,
	fetchRoles,
	logout,
	register,
	updateUserRole,
	removeUser,
	fetchPost,
} from './operations';

export const server = {
	authorize,
	fetchUsers,
	fetchRoles,
	logout,
	register,
	updateUserRole,
	removeUser,
	fetchPost,
};
